import Castle from './castle.jpg';
import './css/castle.css';

function HomePage() {
    return (
        <div> {/* 부모 요소로 감싸기 */}
            <h1>Welcome to the castle</h1> {/* h1은 div 바깥에 두어도 괜찮다 */}
